const prev = items[0].json;
const prevALL = Array.isArray(prev.allVideos) ? prev.allVideos : [];

const rawItems = items[0].json.items || [];
const newItems = Array.isArray(rawItems)
  ? rawItems.map(item => ({
      videoId: item.id.videoId,
      title: item.snippet.title,
      channelId: item.snippet.channelId,
      publishedAt: item.snippet.publishedAt,
      searchTerm: prev.q,
      idioma: prev.idioma,
      origem: prev.origem
    }))
  : [];

return [{
  json: {
    allVideos: [...prevALL, ...newItems],
    pageToken: items[0].json.nextPageToken || '',
    currentPage: typeof prev.currentPage === 'number' ? prev.currentPage + 1 : 1,
    maxPages: typeof prev.maxPages === 'number' ? prev.maxPages : 3,
    q: prev.q,
    idioma: prev.idioma,
    origem: prev.origem
  }
}];

const flat = items.flatMap(i => i.json.allVideos);
const seen = new Set();
return flat
  .filter(v => {
    if (seen.has(v.videoId)) return false;
    seen.add(v.videoId);
    return true;
  })
  .map(v => ({ json: v }));

const responseItem = items.find(i => Array.isArray(i.json.items));
if (!responseItem) return [];
return responseItem.json.items.map(video => ({ json: video }));

return items.map(item => {
  const v = item.json;

  const iso = v.contentDetails?.duration || '';
  const parts = iso.match(/PT(?:(\d+)H)?(?:(\d+)M)?(?:(\d+)S)?/);
  const h = parseInt(parts?.[1] || '0', 10);
  const m = parseInt(parts?.[2] || '0', 10);
  const s = parseInt(parts?.[3] || '0', 10);
  const totalSec = h * 3600 + m * 60 + s;
  const pad = num => String(num).padStart(2, '0');
  const hhmmss = `${pad(h)}:${pad(m)}:${pad(s)}`;

  const tagsArray = v.snippet?.tags || [];
  const topicArray = v.topicDetails?.topicCategories || [];
  const videoLang = v.snippet?.defaultAudioLanguage || v.snippet?.defaultLanguage || null;

  return {
    json: {
      ...v,
      tags: tagsArray,
      topic_categories: topicArray,
      durationRaw: iso,
      durationSec: totalSec,
      durationHHMMSS: hhmmss,
      video_language: videoLang  // <- nova coluna aqui
    }
  };
});

return items.map(item => {
  return {
    json: {
      ...item.json,
      tags: { tags: item.json.tags }, // ← transforma array em objeto
      topic_categories: { categories: item.json.topic_categories }
    }
  }
});

const termos = [

  // GERAIS / GLOBAIS
  { termo: "AI", idioma: "en", origem: "Global", tipo: "curto", tema: "Geral", regiao_macro: "Global" },
  { termo: "IA", idioma: "pt", origem: "Global", tipo: "curto", tema: "Geral", regiao_macro: "Global" },
  { termo: "inteligencia artificial", idioma: "es", origem: "Global", tipo: "curto", tema: "Geral", regiao_macro: "Global" }
];

return termos.map(item => ({
  json: {
    q: item.termo,
    idioma: item.idioma,
    origem: item.origem,
    tipo: item.tipo,
    tema: item.tema,
    regiao_macro: item.regiao_macro,
    pageToken: '',
    allVideos: [],
    currentPage: 0,
    maxPages: 3
  }
}));
